const { Title } = Typography;
const { Content } = Layout;

const DangNhap = () => {
    return (
        <Layout>
            <Content>
                <Title class="titleDN">Đăng Nhập Nhà Bán</Title>
                
            </Content>
        </Layout>
    );
}

export default DangNhap;
